		{id: 3, name: 'Masik', status: 'Dog', message: 'Meow!', likesCount: '999'}
	],
	dialogs: [
		{id: 1, name: 'Anton'},
		{id: 2, name: 'Natasha'},
		{id: 3, name: 'Masik'}
	],
	messages: [
		{id: 1, message: 'Hello'},
		{id: 2, message: 'Hello, how are you?'},
		{id: 3, message: 'Good'}
	]
};

